import { useHistory } from 'react-router-dom';

export function CartItem (){
    const history = useHistory();
    console.log( localStorage.token )
return(
    <>
    {localStorage.token &&
     <h1>Cart Item</h1>
     }
     {!localStorage.token &&
      history.push("./")
     }
   
    </>
);
}
